import React from 'react';
import s from './bag.module.css'

const Bag = (props) => {
    return (
        <div className={s.grid}>
            <div className={s.grid1}>
<p>Dune</p>
<p>Comigo</p>
<p>Samsung</p>
<p>LG</p>
<p>Android</p>
            </div>
            <div className={s.grid2}>
<textarea></textarea>
<div>ddd</div>
            </div>
        </div>
    )
}
export default Bag;
